import React from 'react';

function navbar() {
return (
    
        <nav>
            <div className="menu">
            <div class="logo">
                    <a href="/">Portfolio</a>
                    </div>
                    <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/career">Career</a></li>
                    <li><a href="/contact">Contact</a></li>
                    <li><a href="/login">Logout</a></li>
                    </ul>
            </div>
        </nav>
    );
}

export default navbar;
